pedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B3%D1%80%D0%B0%D1%84\" title=\"\u0422\u0435\u043b\u0435\u0433\u0440\u0430\u0444\">\u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043d\u043e\u0439<\/a> \u043b\u0438\u043d\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0415\u0432\u0440\u043e\u043f\u044b<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904\" class=\"mw-redirect\" title=\"1904\">1904<\/a>&#160;\u2014 \u0432 \u043b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u0435 \u00ab\u0418\u043b\u043b\u044e\u0441\u0442\u0440\u0435\u0439\u0442\u0435\u0434 \u041c\u0438\u0440\u0440\u043e\u0440\u00bb \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u043f\u0443\u0431\u043b\u0438\u043a\u0443\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B2%D0%B5%D1%82%D0%BD%D0%B0%D1%8F_%D1%84%D0%BE%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%8F\" title=\"\u0426\u0432\u0435\u0442\u043d\u0430\u044f \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f\">\u0446\u0432\u0435\u0442\u043d\u0430\u044f \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907\" class=\"mw-redirect\" title=\"1907\">1907<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043d\u0430 \u0443\u043b\u0438\u0446\u0430\u0445 \u043f\u043e\u044f\u0432\u0438\u043b\u0438\u0441\u044c \u043f\u0435\u0440\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BA%D1%81%D0%B8\" title=\"\u0422\u0430\u043a\u0441\u0438\">\u0442\u0430\u043a\u0441\u0438<\/a> \u0441\u043e \u0441\u0447\u0451\u0442\u0447\u0438\u043a\u0430\u043c\u0438. \u0421\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e, \u0442\u043e\u0433\u0434\u0430 \u0438 \u0440\u043e\u0434\u0438\u043b\u043e\u0441\u044c \u0441\u0430\u043c\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u044d\u0442\u043e\u0433\u043e \u0432\u0438\u0434\u0430 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0433\u043e \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0430 \u043f\u043e \u0434\u0430\u043d\u043d\u043e\u043c\u0443 \u0441\u0447\u0451\u0442\u0447\u0438\u043a\u0430\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044f \u0442\u0430\u043a\u0441\u0438\u043c\u0435\u0442\u0440\u043e\u0432 (\u043e\u0442 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u0441\u043b\u043e\u0432\u0430 \u00abtaxe\u00bb \u0438 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u00abmetron\u00bb, \u043e\u0437\u043d\u0430\u0447\u0430\u044e\u0449\u0438\u0445 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u00ab\u043f\u043b\u0430\u0442\u0430\u00bb \u0438 \u00ab\u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u0435\u00bb). \u041f\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0432\u0448\u0438\u0435 \u043f\u0440\u043e\u0439\u0434\u0435\u043d\u043d\u043e\u0435 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0441\u0447\u0451\u0442\u0447\u0438\u043a\u0438 \u0438\u0437\u0431\u0430\u0432\u0438\u043b\u0438 \u0432\u043e\u0434\u0438\u0442\u0435\u043b\u0435\u0439 \u0438 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u043e\u0442 \u0441\u043f\u043e\u0440\u043e\u0432, \u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u043f\u043b\u0430\u0442\u0438\u0442\u044c \u0437\u0430 \u043f\u043e\u0435\u0437\u0434\u043a\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#