A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%82%D0%B5%D0%BB%D0%B5%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5_%D0%93%D0%BE%D1%81%D1%82%D0%B5%D0%BB%D0%B5%D1%80%D0%B0%D0%B4%D0%B8%D0%BE_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0435 \u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u0435 \u0413\u043e\u0441\u0442\u0435\u043b\u0435\u0440\u0430\u0434\u0438\u043e \u0421\u0421\u0421\u0420\">\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u0442\u0443\u0434\u0438\u044f \u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957\" class=\"mw-redirect\" title=\"1957\">1957<\/a>&#160;\u2014 \u0434\u043b\u044f \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0438\u0445 \u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0446\u0435\u043b\u0435\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u0438<\/a> \u0432\u0432\u0435\u0434\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B4%D0%B8%D0%BD%D1%8B%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%B0%D0%BB%D0%B5%D0%BD%D0%B4%D0%B0%D1%80%D1%8C_%D0%98%D0%BD%D0%B4%D0%B8%D0%B8\" title=\"\u0415\u0434\u0438\u043d\u044b\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044c \u0418\u043d\u0434\u0438\u0438\">\u0415\u0434\u0438\u043d\u044b\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044c<\/a>, \u0432 \u043e\u0441\u043d\u043e\u0432\u0443 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0430 \u044d\u0440\u0430 \u0421\u0430\u043a\u0430. \u0412 \u0432\u0438\u0441\u043e\u043a\u043e\u0441\u043d\u043e\u043c \u0433\u043e\u0434\u0443 \u0432 \u043c\u0435\u0441\u044f\u0446\u0435 \u0447\u0430\u0439\u0442\u0440\u0430 31 \u0434\u0435\u043d\u044c \u0438 \u043d\u0430\u0447\u0430\u043b\u043e \u0433\u043e\u0434\u0430 \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0435\u0442 \u0441 21 \u043c\u0430\u0440\u0442\u0430, \u0432 \u043f\u0440\u043e\u0441\u0442\u043e\u043c \u0433\u043e\u0434\u0443 \u044d\u0442\u043e\u0442 \u043c\u0435\u0441\u044f\u0446 \u0438\u043c\u0435\u0435\u0442 30 \u0434\u043d\u0435\u0439 \u0438 \u0435\u0433\u043e \u043d\u0430\u0447\u0430\u043b\u043e \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0430 22 \u043c\u0430\u0440\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963\" class=\"mw-redirect\" title=\"1963\">1963<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Beatles\" title=\"The Beatles\">The Beatles<\/a> \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u0430\u043b\u044c\u0431\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Please_Please_Me_(%D0%B0%D0%BB%D1%8C%D0%B1%D0%BE%D0%BC)\" title=\"Please Please Me (\u0430\u043b\u044c\u0431\u043e\u043c)\">Please Please Me<\/a>, \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u0434\u043e\u043b\u0433\u043e\u0438\u0433\u0440\u0430\u044e\u0449\u0438\u0439 \u0430\u043b\u044c\u0431\u043e\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0441\u0440\u0430\u0437\u0443 \u0436\u0435 \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442 \u043b\u0438\u0434\u0438\u0440\u0443\u044e\u0449\u0438\u0435 \u043f\u043e\u0437\u0438\u0446\u0438\u0438 \u0432 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B8%D1%82-%D0%BF%D0%B0%D1%80%D0%B0%D0%B4\" title=\"\u0425\u0438\u0442-\u043f\u0430\u0440\u0430\u0434\">\u0445\u0438\u0442-\u043f\u0430\u0440\u0430\u0434\u0430\u0445<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989\" class=\"mw-redirect\" title=\"1989\">1989<\/a>&#160;\u2014 \u0432 \u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u041f\u043e\u043b\u0451\u0442\">\u043f\u043e\u043b\u0451\u0442\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-225\" title=\"\u0410\u043d-225\">\u0410\u043d-225<\/a> \u00ab\u041c\u0440\u0438\u044f\u00bb \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e 109 \u043c\u0438\u0440\u043e\u0432\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BA%D0%BE%D1%80%D0%B4\" title=\"\u0420\u0435\u043a\u043e\u0440\u0434\">\u0440\u0435\u043a\u043e\u0440\u0434\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990\" class=\"mw-redirect\" title=\"1990\">1990<\/a> \u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%85%D1%82%D0%B5%D1%80%D0%B5%D0%B2%D0%B0,_%D0%9D%D0%B0%D1%82%D0%B0%D0%BB%D1%8C%D1%8F_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0411\u0435\